description:
Classic / Retro
---------------
Chi avrebbe mai pensato che ai giorni nostri,dopo piu di 10 anni dalla tragica scomparsa della nostra carissima ed amatissima Moana, la FM riuscisse a tirar fuori film inediti di questa grande attrice? che dire... questa volta i complimenti ce li facciamo da soli, Rocco e Moana faranno il resto. Film per grandi intenditori o collezionisti.

Video: DivX 5 704x576 25.00fps [Stream 00]
Audio: MPEG Audio Layer 3 48000Hz stereo 128kbps [Stream 01]

